    public function stationAction(){
        $data = [];

        $data['latitude'] = $this->getRequest()->getQuery('latitude');
        $data['longitude'] = $this->getRequest()->getQuery('longitude');
	    $data['keyword'] = $this->getRequest()->getQuery('keyword');
	    $curl = new Curl();
	    $resp = $curl->setData($data)->send('mall/public/getStationMapList');
	    $json = json_encode($resp);
	    echo $json;	
	    exit;
    }

    public function haibaoAction($type=1){

        $userid = $this->getRequest()->getQuery('cpsid');
        $info = [];
        $shopkeeper = false;
        if(!empty($userid)){
            $info = M('t_wx_user')->get(
                                        [
                                            'userid',
                                            'nickname(name)',
                                            'headimgurl',
                                            'unionid',
                                            'qr_ticket',
                                            'qr_expire_seconds',
                                            'qr_create_time',
                                        ],
                                        ['userid'=>$userid]
                                        );


            $curl = new Curl();

            if(!empty($info)){
                $resp = $curl->setData(['distributionUserId'=>$info['unionid']])
                    ->setApiUrl($this->config->url->api->sdp)
                    ->send('distribution/isShopkeeper');
                if(!empty($resp) && $resp['shopkeeper']){
                    $shopkeeper = $resp['shopkeeper'];
                }
            }
        }

        $file_path = 'attr/haibao/'.md5($userid).$type.'.jpg';

//        //如果是微商并且海报文件不存在，或者二维码已经过期（7天）
//        if(
//            ($shopkeeper && !file_exists($file_path)) ||
//            (
//                !empty($info) &&
//                (time()-intval($info['qr_create_time']) > intval($info['qr_expire_seconds']))
//            )
//        ){
        //如果是微商并且海报文件不存在
        if($shopkeeper && !file_exists($file_path)){
            $qrcode_path = get_wx_qrcode($this->wechat,$info);

            if(!empty($qrcode_path)){
                //如果文件存在，则删除之
                if(file_exists($file_path)){
                    @unlink($file_path);
                }
                //header("Content-type: image/jpeg");

                $avator = new Image();
                $avator->read(file_get_contents($info['headimgurl']));

                $qrcode = new Image();
                $qrcode->read(file_get_contents($qrcode_path));

                $image = new Image();

                $image->open('mex/images/haibaobg_'.$type.'.jpg')
                    ->combine($avator->thumb(90,90)->show(),510,25)
                    ->combine($qrcode->thumb(300,300)->show(),40,160)
                    ->text($info['name'],'v2/fonts/yahei.ttf',25,'#ae0808',480,150)
                //->show();die;
                    ->save($file_path);
            }
        }

        $this->getView()->assign('shopkeeper',$shopkeeper);
        $this->getView()->assign('file_path',$file_path);
        $this->getView()->assign('type',$type);
        $this->getView()->assign('info',$info);
        $this->getView()->assign('userid',$userid);
    }

